<span class="token comment"># \u5728\u8C03\u7528\u751F\u6210\u5668\u8FD0\u884C\u7684\u8FC7\u7A0B\u4E2D\uFF0C\u6BCF\u6B21\u9047\u5230 yield \u65F6\u51FD\u6570\u4F1A\u6682\u505C\u5E76\u4FDD\u5B58\u5F53\u524D\u6240\u6709\u7684\u8FD0\u884C\u4FE1\u606F\uFF0C\u8FD4\u56DE yield \u7684\u503C, \u5E76\u5728\u4E0B\u4E00\u6B21\u6267\u884C next() \u65B9\u6CD5\u65F6\u4ECE\u5F53\u524D\u4F4D\u7F6E\u7EE7\u7EED\u8FD0\u884C\u3002</span>
